import React from 'react';

import { Footer, Blog, Possibility, Header, WhatGPT3 } from './containers';
import { CTA, Brand, Navbar, Feature } from './components';

const App = () => {
  return (
    <div className='App'>
      <div className= "gradient__bg">
        <Navbar />
        <Navbar />

      </div>
      <Brand />
      <WhatGPT3 />
      <Features />
      <Possibility />
      <CTA />
    </div>
  )
}

export default App
